import { Web_pilot } from "../../web_pilot/web_pilot";
import { NickNames } from "./nickName";
import { WaitForPlayers } from "./waitForPlayers.jsx";

const apiURL = process.env.WEB_PILOT_APP_API_URL;

/*Does not return a WebSocket
